그렇게 맥락없이 일진미화로 비하시키는게 폭력이란걸 모르나?? 키보드 뒤에 숨어서 욕하는거 ㅈㄴ극혐

베스트 글에 반면을 얘기하자면, 이런 말도 있다.
&quot;잘못 들어서지 않는 사람은 없다. 또한, 잘못 들어선 길로 원하는 목적지에 도달할 수 도 있다.&quot;
&quot;틀린 길은 없다. 다른 길이 있을 뿐이다.&quot;
